// import logo from './logo.svg';
import './App.css';
import Header from './Header';
import Banner from './Banner';
import Music from './Music.js';
import Footer from './Footer.js';
import Headerleft from './Header_left';
import Headerleftbtm from './Header_left_btm.js';
import song from './songs/song.mp3';
import cheq from './images/cheques.jpeg'
const arr1 = [
  {
    thumbnail: { cheq },
    song: "cheques",


  },
  {
    head: "FINANCE DEPARTMENT",
    info: "Building a strong financial system so that we can never get out of resources and give best services to our patients. "

  },
  {
    head: "DONATION DEPARTMENT",
    info: "Book a creative consult with us to discuss a customized event for your organization or a sponsorship of our award-winning programs."

  },
  {
    head: " DEPARTMENT",
    info: "Book a creative consult with us to discuss a customized event for your organization or a sponsorship of our award-winning programs."

  }
]

function App() {
  return (
    <div className="App">
      <div className='Header_banner'>
        <Header />
        <div className="banner">
          {arr1.map((data) => {
            return <Banner song={data.song} thumb={data.thumbnail} />
          })}
        </div>
        <Music />
        <Footer />
      </div>
      {/* left side */}
      <div className='all_left_side'>
        <div className='Header_banner_left'>
          <Headerleft />
        </div>
        <div className='Header_banner_left_btm'>
          <Headerleftbtm />
        </div>
      </div>
    </div>
  );
}

export default App;
